import { useState, useEffect } from "react";

const Info = () => {
  const [data, setData] = useState(null);

  useEffect(() => {
    fetch("/users")
      .then((res) => res.json())
      .then((actualData) => setData(actualData["items"]));
  }, []);

  const pastLogins = data[0].pastlogins.map((login) => <li>{login}</li>);

  return (
    <div className="info-container">
      <p className="info-data-text">
        {!data ? "Loading..." : "Username: " + data[0].name}
      </p>
      <p className="info-data-text">
        {!data ? "Loading..." : "Last Login: " + data[0].lastlogin}
      </p>
      <p className="info-data-text">
        {!data ? "Loading..." : "Past Logins: " + pastLogins}
      </p>
    </div>
  );
};

export default Info;
